import React, { useEffect, useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import { useStripe, useElements, CardExpiryElement, CardCvcElement, CardNumberElement } from '@stripe/react-stripe-js';
import '/Users/casha/Desktop/pistola/pistola/client/src/styles/CheckoutForm.css'
import { error } from 'console';

const CheckoutForm: React.FC = () => {
  const location = useLocation();
  const stripe = useStripe();
  const elements = useElements();
  const navigate = useNavigate();
  const { total, email, clientSecret } = location.state || {};

  const [name, setName] = useState<string>('');
  const [streetAddress, setStreetAddress] = useState<string>('');
  const [city, setCity] = useState<string>('');
  const [postalCode, setPostalCode] = useState<string>('');
  const [country, setCountry] = useState<string>('');
  const [provinceOrState, setProvinceOrState] = useState<string>('');
  const [phoneNumber, setPhoneNumber] = useState<string>('');

  const handleSubmit = async (event: React.FormEvent) => {
    event.preventDefault();

    if (!stripe || !elements) {
      return;
    }

    const cardNumberElement = elements.getElement(CardNumberElement);

    const { error, paymentIntent } = await stripe.confirmCardPayment(clientSecret, {
      payment_method: {
        card: cardNumberElement!,
        billing_details: {
          name,
          email,
          phone: phoneNumber,
          address: {
            line1: streetAddress,
            city,
            postal_code: postalCode,
            country,
            state: provinceOrState,
          },
        },
      },
    });

    if (error) {
      console.error(error);
    } else if (paymentIntent && paymentIntent.status === 'succeeded') {
      navigate('/success');
    }
  };

  return (
        <form onSubmit={handleSubmit}>

          <div className='form=title'>CHECKOUT</div>

          <div className='shipping-details-title'>SHIPPING DETAILS</div>

          <br></br>

          <div className='form-group'>
            <label>
              Name
              <input
              type="text"
              value={name}
              onChange={(e) => setName(e.target.value)}
              />
            </label>
          </div>
          <div className='form-group'>
            <label>
              Street Address
              <input
              type="text"
              value={streetAddress}
              onChange={(e) => setStreetAddress(e.target.value)}
              required
            />
            </label>
          </div>
          <div className='form-group'>
        <label>
          City
          <input
            type="text"
            value={city}
            onChange={(e) => setCity(e.target.value)}
            required
          />
        </label>
      </div>
      <div className='form-group'>
        <label>
          Postal Code
          <input
            type="text"
            value={postalCode}
            onChange={(e) => setPostalCode(e.target.value)}
            required
          />
        </label>
      </div>
      <div className='form-group'>
        <label>
          Country
          <input
            type="text"
            value={country}
            onChange={(e) => setCountry(e.target.value)}
            required
          />
        </label>
      </div>
      <div className='form-group'>
        <label>
          Province/State
          <input
            type="text"
            value={provinceOrState}
            onChange={(e) => setProvinceOrState(e.target.value)}
            required
          />
        </label>
      </div>
      <div className='form-group'>
        <label>
          Phone
          <input
          type='number'
          value={phoneNumber}
          onChange={(e) => setPhoneNumber(e.target.value)}
          required
          />
        </label>
      </div>

      <div className='shipping-method_container'>
      <div className='shipping-method-heading'>Shipping Method</div>
      <br></br>


      </div>
          <div>
            <label>
              Card Number
              <CardNumberElement />
            </label>
          </div>
          <div>
            <label>
              Expiry Date 
              <CardExpiryElement />
            </label>
          </div>
          <div>
            <label>
              CVC
              <CardCvcElement />
            </label>
          </div>
          <button type="submit" disabled={!stripe || !elements}>
            Pay ${total ? total.toFixed(2) : '0.00'} CAD
          </button>
        </form>
      );
    };

export default CheckoutForm;
